import React from 'react';

function CustomButton({ variant }) {
  let buttonText = '';

  switch (variant) {
    case 'login':
      buttonText = 'Connection';
      break;
    case 'Enrollment':
      buttonText = 'S\'enregistrer';
      break;
    default:
      buttonText = 'Bouton';
  }

  return <button>{buttonText}</button>;
}

export default CustomButton;
